# Output file name
def get_output_file(num_rows):
    return str(num_rows) + "_output.csv"



def hash_password(password: str, salt: bytes) -> str:
    hashed = hashlib.pbkdf2_hmac('sha256', COMMON_PASSWORD.encode(), salt, PBKDF2_ITERATIONS, dklen=CREDENTIAL_LEN)
    return base64.b64encode(hashed).decode()

def generate_salt() -> str:
    salt = os.urandom(CREDENTIAL_LEN)  # Generate a 32-byte salt
    return base64.b64encode(salt).decode()


# Generate random DOB
def generate_random_dob(min_age=18, max_age=100):
    # Calculate the date range
    today = datetime.today()
    max_date = today - timedelta(days=min_age * 365)
    min_date = today - timedelta(days=max_age * 365)

    # Generate a random date within this range
    random_date = min_date + (max_date - min_date) * random.random()

    # Return the date in YYYY-MM-DD format
    return random_date.strftime("%Y-%m-%d")


